// RequestModal.js
import React from 'react';
import './RequestModal.css'; // 모달 스타일

const RequestModal = ({ requests, onClose }) => {
  return (
    <div className="request-modal">
      <div className="modal-content">
        <h2>멤버 등록 요청 목록</h2>
        <button className="close-button" onClick={onClose}>X</button>
        <ul>
          {requests.map((request) => (
            <li key={request.id}>
              <img src={request.doctor.profileImagePath || 'default-profile.png'} alt={request.doctor.name} />
              <p>{request.doctor.name} - {request.doctor.id.number}</p>
              <p>{request.doctor.phone}</p>
              <button className="accept-button">✔️</button>
              <button className="decline-button">❌</button>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default RequestModal;
